import React, { useState, useEffect } from "react";
import "./Players.css";

const Players = () => {
  const [players, setPlayers] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const playersPerPage = 10;
  const paginationGroupSize = 10;
  const [selectedFilters, setSelectedFilters] = useState({
    uniqueId: '',
    club: '',
    nationality: '',
    league: '',
    // Add other filter properties here (e.g., wonderkids: false, contractExpiring: false, ...)
  });
  const handleUniqueIdChange = (event) => {
    setSelectedFilters({ ...selectedFilters, uniqueId: event.target.value });
  };
  
  const handleClubChange = (event) => {
    setSelectedFilters({ ...selectedFilters, club: event.target.value });
  };
  
  // Implement similar handlers for other filter groups (nationality, league, etc.)
  
  const handleCheckboxChange = (event) => {
    const { name, checked } = event.target;
    setSelectedFilters({ ...selectedFilters, [name]: checked });
  };
  const filteredPlayers = currentPlayers.filter((player) => {
    let isIncluded = true;
  
    // Filter by unique ID
    if (selectedFilters.uniqueId && !player.id.toString().includes(selectedFilters.uniqueId)) {
      isIncluded = false;
    }
  
    // Filter by club
    if (selectedFilters.club && !player.club.toLowerCase().includes(selectedFilters.club.toLowerCase())) {
      isIncluded = false;
    }
  
    // Add similar filter conditions for other properties (nationality, league, etc.)
  
    // Filter by checkbox selections (e.g., wonderkids, contractExpiring, ...)
    if (selectedFilters.wonderkids && player.rating < 80) {
      isIncluded = false;
    }
  
    // Add similar filter conditions for other checkboxes
  
    return isIncluded;
  });

  useEffect(() => {
    const data = Array.from({ length: 8000 }, (_, i) => ({
      id: i + 1,
      name: `Player ${i + 1}`,
      club: `Club ${i % 20}`,
      nationality: `Country ${i % 10}`,
      position: ["GK", "DC", "MC", "ST"][i % 4],
      rating: Math.floor(Math.random() * 10) + 80,
      contractUntil: "06-2025",
      wage: `${Math.floor(Math.random() * 400) + 50}K p/w`,
      image: i % 7 === 0 ? null : `https://via.placeholder.com/50?text=P${i + 1}`,
    }));
    setPlayers(data);
  }, []);

  const totalPages = Math.ceil(players.length / playersPerPage);
  const indexOfLastPlayer = currentPage * playersPerPage;
  const indexOfFirstPlayer = indexOfLastPlayer - playersPerPage;
  const currentPlayers = players.slice(indexOfFirstPlayer, indexOfLastPlayer);

  // Şu anki sayfa grubunun başlangıç ve bitiş indekslerini hesapla
  const currentPaginationGroup = Math.floor((currentPage - 1) / paginationGroupSize);
  const startPage = currentPaginationGroup * paginationGroupSize + 1;
  const endPage = Math.min(startPage + paginationGroupSize - 1, totalPages);

  // Sayfa değiştirme işlemleri
  const paginate = (pageNumber) => {
    if (pageNumber > 0 && pageNumber <= totalPages) setCurrentPage(pageNumber);
  };

  // Grup değiştirme işlemleri (sol ve sağ tuşlar için)
  const goToPreviousGroup = () => {
    const previousGroupStart = startPage - paginationGroupSize;
    if (previousGroupStart > 0) {
      setCurrentPage(previousGroupStart);
    } else {
      setCurrentPage(1); // En başa gidiyoruz
    }
  };

  const goToNextGroup = () => {
    const nextGroupStart = startPage + paginationGroupSize;
    if (nextGroupStart <= totalPages) {
      setCurrentPage(nextGroupStart);
    } else {
      setCurrentPage(totalPages); // En sona gidiyoruz
    }
  };
  

  return (
    <div className="players-page">
      <aside className="players-sidebar">
        <h2>Filters</h2>
        {/* Unique ID Filter */}
        <div className="filter-group">
          <label htmlFor="uniqueId">Unique ID</label>
          <input type="text" id="uniqueId" placeholder="Unique ID" />
        </div>

        {/* Club Filter */}
        <div className="filter-group">
          <label htmlFor="club">Club</label>
          <input type="text" id="club" placeholder="Club" />
        </div>

        {/* Nationality Filter */}
        <div className="filter-group">
          <label htmlFor="nationality">Nationality</label>
          <input type="text" id="nationality" placeholder="Nationality" />
        </div>

        {/* League Filter */}
        <div className="filter-group">
          <label htmlFor="league">League</label>
          <input type="text" id="league" placeholder="League" />
        </div>

        {/* Smart Filters */}
        <div className="section-title"><strong>Smart Filters
          </strong></div>
        <div className="checkbox-group">

          <tr>
            <label>
              <input type="checkbox" /> Wonderkids
            </label>
          </tr>
          <tr>
            <label>
              <input type="checkbox" /> Contract expiring
            </label>
          </tr>
          <tr>
            <label>
              <input type="checkbox" /> Free transfers
            </label>

          </tr>
          <tr>
            <label>
              <input type="checkbox" /> Best Bargains
            </label>
          </tr>
          <tr>
            <label>
              <input type="checkbox" /> Dynamic Potential
            </label>
          </tr>
          <tr>
            <label>
              <input type="checkbox" /> Fast paced
            </label>
          </tr>
        </div>
        <br></br>
        {/* Line */}
        <div className="section-title">
          <strong>Line</strong></div>
        <div className="checkbox-group">

          <tr>
            <label>
              <input type="checkbox" /> Goalkeepers
            </label>
          </tr>

          <tr>
            <label>
              <input type="checkbox" /> Defenders
            </label>

          </tr>

          <tr>
            <label>
              <input type="checkbox" /> Midfielders
            </label>
          </tr>
          <tr>
            <label>
              <input type="checkbox" /> Attackers
            </label>

          </tr>
        </div>
        <br></br>
        {/* Position */}
        <div className="section-title"><strong>Position</strong></div>
        <div className="checkbox-group">
          <tr>
            <label>
              <input type="checkbox" /> GK
            </label>
          </tr>
          <tr>
            <label>
              <input type="checkbox" /> DL
            </label>
          </tr>
          <tr>
            <label>
              <input type="checkbox" /> DC
            </label>
          </tr>
          <tr>
            <label>
              <input type="checkbox" /> DR
            </label>
          </tr>
          <tr>
            <label>
              <input type="checkbox" /> WBL
            </label>
          </tr>
          <tr>
            <label>
              <input type="checkbox" /> WBR
            </label>
          </tr>
          <tr>
            <label>
              <input type="checkbox" /> WBR
            </label>
          </tr>
          <tr>
            <label>
              <input type="checkbox" /> ML
            </label>
          </tr>
          <tr>
            <label>
              <input type="checkbox" /> MC
            </label>
          </tr>
          <tr>
            <label>
              <input type="checkbox" /> MR
            </label>
          </tr>
        </div>
        
      </aside>

      <main className="players-list">
        <h1>Players</h1>
        <table>
          <thead>
            <tr>
              <th>Photo</th>
              <th>Name</th>
              <th>Club</th>
              <th>Position</th>
              <th>Rating</th>
              <th>Wage</th>
              <th>Contract</th>
            </tr>
          </thead>
          <tbody>
            {currentPlayers.map((player) => (
              <tr key={player.id}>
                <td>
                  {player.image ? (
                    <img
                      src={player.image}
                      alt={player.name}
                      className="player-photo"
                    />
                  ) : (
                    <div className="placeholder-photo">No Image</div>
                  )}
                </td>
                <td>{player.name}</td>
                <td>{player.club}</td>
                <td>{player.position}</td>
                <td>{player.rating}</td>
                <td>{player.wage}</td>
                <td>{player.contractUntil}</td>
              </tr>
            ))}
          </tbody>
        </table>

        <div className="pagination">
          <button
            className="pagination-btn"
            onClick={goToPreviousGroup}
            disabled={currentPage <= paginationGroupSize}
          >
            &lt;&lt;
          </button>

          {Array.from({ length: endPage - startPage + 1 }, (_, i) => {
            const pageNumber = startPage + i;
            return (
              <button
                key={pageNumber}
                className={`pagination-btn ${
                  currentPage === pageNumber ? "active" : ""
                }`}
                onClick={() => paginate(pageNumber)}
              >
                {pageNumber}
              </button>
            );
          })}

          <button
            className="pagination-btn"
            onClick={goToNextGroup}
            disabled={startPage + paginationGroupSize > totalPages}
          >
            &gt;&gt;
          </button>
        </div>
      </main>
    </div>
  );
};

export default Players;
